Patch from Bob Jervis (bjervis@google.com): In reading the LiveConnect spec, it looks like Mark's problem with overloading
methods is due to a bug in Rhino with respect to how LiveConnect is
implemented.

In NativeJavaObject.java, the getConversionWeight method has the case for
JSTYPE_JAVA_ARRAY and JSTYPE_JAVA_OBJECT shares common code.  In the
LiveConnect 3 spec, section 3.3.6.1 describes wrapped Java objects, and 3.3.6.2
describes wrapped Java arrays.  Mark has a wrapped Java array of byte.

He is trying to call a method that has an overload of byte[] and for byte as
well.  It is reporting an ambiguous choice, which is why we needed the syntax
for selecting the overload.  BUt it looks like this should not be necessary.

According to the spec, you can pass a wrapped Java object to a primitive (non
boolean) type, but you cnnot do so for a wrapped Java array.  Around line 366
in my version of the file, there is a test to account for the JSTYPE_JAVA_ARRAY
for passing to a primitive type.  It looks to me like it should return
CONVERSION_NONE for a wrapped array, but it is returning CONVERSION_NONTRIVIAL.
The relevant lines of code are:

        case JSTYPE_JAVA_OBJECT:
        case JSTYPE_JAVA_ARRAY:
            Object javaObj = fromObj;
            if (javaObj instanceof Wrapper) {
                javaObj = ((Wrapper)javaObj).unwrap();
            }
            if (to.isInstance(javaObj)) {
                return CONVERSION_NONTRIVIAL;
            }
            if (to == ScriptRuntime.StringClass) {
                return 2;
            }
            else if (to.isPrimitive() && to != Boolean.TYPE) {
                return (fromCode == JSTYPE_JAVA_ARRAY)
                       ? CONVERSION_NONTRIVIAL : 2 + getSizeRank(to);
            }
            break;

Top call scope tracking changes: Since E4X implementation needs to know the activation scope for tracking of default namespaces, previously an elaborated schema was added to set/restore the activation scope which relied on the fact that scrip and function with activation record should always call special entry/exit functions.

But that does not work for functions without activation records since they never call any special entry/exit pairs. So if application call such function directly, the function would not store its top scope anywhere and the E4X subsystem would not be able to get E4X library object.

The patch fixes with introduction of 2 functions, hasTopCall and doTopCall to ScriptRuntime and adding the following code prefix to each implementation of Callable.call that can start execution of script code:

    public Object call(Context cx, Scriptable scope,
                       Scriptable thisObj, Object[] args)
        throws JavaScriptException
    {
// Prefix start
        if (!ScriptRuntime.hasTopCall(cx)) {
            return ScriptRuntime.doTopCall(this, cx, scope, thisObj, args);
        }
// Prefix end
        ...

In this way there is always registered top scope during script execution and the previous elaborated schema became unnecessary so I reverted that part to almost pre-E4x state.

Changing just introduced CodeBlock into Callable that define call method with exactly the same signature as Function.call and changing Function to extend Callable. Now Context defines new method "call" that provide optimized version of the following code:

Context cx = Context.enter()
try {
    callable.call(cx, scope, thisObj, args);
} finally {
    Context.exit();
}

Since Function extends Callable, it can be passed to this method directly thus simplifying ScriptableObject.call method and Java adapter code.

The new interface is used in SecurityController implementation which allows to pass interpreted functions there directly as well removing the need to have intermediate class in Interpreter.

